import React from 'react'

function Card(props){

    return <button type ="button" onClick={turnCard}>
        <div className='Card'>{props.affichage ? props.symbol : '-'}</div>
        ></button>

}

function setSymbol(props, symbol){
    props.symbol = symbol
}

function turnCard(props){
    props.affichage = !props.affichage
}



export default Card;
